import React from 'react';
import './phone.css';

const Phone = () => {
  return (
    <div className="phone">
      <Scanner />
      <Label />
    </div>
  );
};

const Scanner = () => {
  return <div className="scanner"></div>;
};

const Label = () => {
  return <div className="label"></div>;
};

function App() {
  return (
    <div className="App">
      <h2>Scan Animation Example</h2>
      <Phone />
    </div>
  );
}

export default App;
